import React, { useState } from 'react';
import './App.css'; // Assuming you have a CSS file

const App = () => {
  const [searchQuery, setSearchQuery] = useState('');

  const popularServices = [
    { name: 'Tension Footers', icon: '‚öíÔ∏è' },
    { name: 'Purchase', icon: 'üõí' },
    { name: 'Washout', icon: 'üíß' },
    { name: 'Gas Type', icon: '‚õΩ' },
    { name: 'Employer', icon: 'üíº' },
    { name: 'Care Care', icon: 'üè•' },
    { name: 'S&P-West', icon: 'üè¢' },
    { name: 'Business & Home', icon: 'üè†' },
  ];

  const providers = [
    { name: 'Your Name', address: 'Address', city: 'City Name' },
    { name: 'City Name', address: 'Address', city: 'City Name' },
    { name: 'City Name', address: 'Address', city: 'City Name' },
    { name: 'City Name', address: 'Address', city: 'City Name' },
  ];

  const handleSearch = (e) => {
    e.preventDefault();
    console.log('Searching for:', searchQuery);
    // Implement search functionality here
  };

  const handleGetStarted = () => {
    console.log('Get Started clicked');
    // Implement navigation or modal
  };

  const handleContactUs = () => {
    console.log('Contacting via: 1234567890');
    // Implement contact functionality
  };

  return (
    <div className="app-container">
      {/* Header Section */}
      <header className="header">
        <div className="header-content">
          <h1 className="main-title">
            Find Employees And Service Providers Near Your City
          </h1>

          <form className="search-form" onSubmit={handleSearch}>
            <div className="search-box">
              <input
                type="text"
                placeholder="Search Service Providers and Employees near..."
                value={searchQuery}
                onChange={(e) => setSearchQuery(e.target.value)}
                className="search-input"
              />
              <button type="submit" className="search-button">
                üîç
              </button>
            </div>
          </form>
        </div>
      </header>

      {/* Hero Section */}
      <section className="hero-section">
        <div className="hero-left">
          <h2 className="hero-title">Explore Your Skills!!!</h2>
          <p className="hero-subtitle">Companies Are Searching For You?</p>
          <button className="cta-button" onClick={handleGetStarted}>
            Get Started
          </button>
        </div>

        <div className="hero-right">
          <div className="hire-card">
            <h3 className="hire-title">We Want To Hire You</h3>
            <button className="contact-button" onClick={handleContactUs}>
              Contact Us: 1234567890
            </button>
          </div>
        </div>
      </section>

      {/* Popular Services Section */}
      <section className="services-section">
        <h2 className="section-title">Popular Services</h2>
        <div className="services-grid">
          {popularServices.map((service, index) => (
            <div key={index} className="service-card">
              <span className="service-icon">{service.icon}</span>
              <span className="service-name">{service.name}</span>
            </div>
          ))}
        </div>
      </section>

      {/* Service Providers Section */}
      <section className="providers-section">
        <h2 className="section-title">Service Providers Near You</h2>
        <div className="providers-grid">
          {providers.map((provider, index) => (
            <div key={index} className="provider-card">
              <h3 className="provider-name">{provider.name}</h3>
              <p className="provider-address">{provider.address}</p>
              <p className="provider-city">{provider.city}</p>
            </div>
          ))}
        </div>
      </section>

      {/* Footer */}
      <footer className="footer">
        <div className="footer-content">
          <div className="footer-links">
            <a href="#" className="footer-link">Global Privacy</a>
            <a href="#" className="footer-link">Social & Human</a>
          </div>
          <p className="copyright">¬© 2024 Service Marketplace. All rights reserved.</p>
        </div>
      </footer>
    </div>
  );
};

export default App;
